import React from 'react'
import './NavBar.css'

function NavBar() {
    return (
        <div className='navbar'>
            <h1 style={{color:'white'}} className='logo'>Leaper</h1>
            <img className='avatar' src="data:image/png;base64," alt="" />
        </div>
    )
}

export default NavBar
